<div class="container-fluid">

            <input type="text" id="variable-selector">

        </div>
    </div>

        <div class="collapse col-xs-12" id="settings-collapse">

                        </div>

                            <form class="form-inline">

                            </form>

                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>

    <div class="row">
        <div id="chart-container" style="min-width: 310px;"></div>
    </div>
</div>
